static char __pyx_doc_8treedict_8treedict_8TreeDict_14convertTo[] = "\n        Converts the local tree and branches to an external format\n        given by the `format` parameter.  Currently, the only\n        supported value for `format` is 'nested_dict', which returns\n        the tree as a nested dictionary of ``key : value`` pairs.\n\n        'nested_dict' format:\n\n          Returns the tree contained in nested dictionaries, with each\n          branch being another dict instance.\n\n          The 'nested_dict' format supports three keyword parameters:\n\n          - ``convert_values = False`` causes only those TreeDict\n            instances present somewhere in the tree as branches to be\n            converted to python dictionaries.  All values that refer\n            to a separate converted branch will still be converted,\n            however.\n\n          - ``prune_empty = True`` causes all empty branches to be\n            ignored.  Without this parameter, they show up as empty\n            dictionaries.\n\n          - ``expand_lists = True`` causes all lists present as\n            values in the tree to be searched for TreeDict instances;\n            within these lists, any TreeDict instances will be\n            converted to dictionaries.  This cannot be combined with\n            ``convert_values = False``.\n\n          Example 1::\n\n            >>> from treedict import TreeDict\n            >>> t = TreeDict.fromdict({'a.x' : 1, 'a.y' : 2, 'z' : 3})\n            >>> print t.makeReport()\n            z   = 3\n            a.x = 1\n            a.y = 2\n            >>> print t.convertTo('nested_dict')\n            {'a': {'y': 2, 'x': 1}, 'z': 3}\n\n          One thing to note is that TreeDict values within the tree\n          are treated as values, unless the corresponding branch is\n          somewhere in the conversion as well, in which case all such\n          values are replaced with the same dictionary.  This allows\n          recursive definitions (e.g. TreeDict values being parents or\n          dictionary values ""being the dictionary) to translate\n          correctly between :meth:`convertTo` and :meth:`fromdict`.\n\n          Example 2::\n\n            >>> from treedict import TreeDict\n            >>> t = TreeDict()\n            >>> t.a = t\n            >>> print t.makeReport()\n            a = TreeDict <root>\n            >>> d = t.convertTo('nested_dict')\n            >>> print d\n            {'a': {...}}\n            >>> d['a'] is d\n            True\n\n          Example 3::\n\n            >>> t = TreeDict()\n            >>> t.a = TreeDict(x = 1)\n            >>> print t.convertTo('nested_dict')\n            {'a': TreeDict <root>}\n            >>> t2 = TreeDict()\n            >>> t2.b.x = 1\n            >>> t2.a.x = t.b\n            >>> print t2.convertTo('nested_dict')\n            {'b': {'x': 1}}\n\n        ";
